import React from 'react';

const SkillsMobileHorizontal = () => {
  const skillCategories = [
    {
      title: "Frontend",
      skills: [
        { name: "HTML5", icon: "devicon-html5-plain colored" },
        { name: "CSS3", icon: "devicon-css3-plain colored" },
        { name: "JavaScript", icon: "devicon-javascript-plain colored" },
        { name: "React", icon: "devicon-react-original colored" }
      ]
    },
    {
      title: "Backend",
      skills: [
        { name: "Python", icon: "devicon-python-plain colored" },
        { name: "Django", icon: "devicon-django-plain colored" },
        { name: "Node.js", icon: "devicon-nodejs-plain colored" },
        { name: "Java", icon: "devicon-java-plain colored" }
      ]
    },
    {
      title: "Database",
      skills: [
        { name: "PostgreSQL", icon: "devicon-postgresql-plain colored" },
        { name: "MySQL", icon: "devicon-mysql-plain colored" },
        { name: "MongoDB", icon: "devicon-mongodb-plain colored" },
        { name: "Redis", icon: "devicon-redis-plain colored" }
      ]
    },
    {
      title: "DevOps",
      skills: [
        { name: "Docker", icon: "devicon-docker-plain colored" },
        { name: "AWS", icon: "devicon-amazonwebservices-plain colored" },
        { name: "Git", icon: "devicon-git-plain colored" },
        { name: "Linux", icon: "devicon-linux-plain colored" }
      ]
    }
  ];

  return (
    <section id="skills" className="py-12 bg-tech-blue text-white">
      <div className="max-w-6xl mx-auto px-4">
        <div className="text-center mb-8">
          <h2 className="text-3xl font-bold mb-2">
            <span className="gradient-text">Tech Stack</span>
          </h2>
          <p className="text-tech-light/60 text-sm">Technologies across the stack</p>
        </div>

        {/* Mobile: Category-based horizontal scroll */}
        <div className="lg:hidden space-y-6 mb-8">
          {skillCategories.map((category, catIndex) => (
            <div key={catIndex}>
              <h3 className="text-lg font-bold text-tech-cyan mb-3">{category.title}</h3>
              <div className="flex overflow-x-auto pb-3 space-x-3">
                {category.skills.map((skill, skillIndex) => (
                  <div 
                    key={skillIndex}
                    className="flex-shrink-0 flex flex-col items-center p-4 bg-tech-navy/30 rounded-xl border border-tech-cyan/10 min-w-[85px]"
                  >
                    <i className={`${skill.icon} text-xl mb-2`}></i>
                    <span className="text-xs text-tech-light text-center">
                      {skill.name}
                    </span>
                  </div>
                ))}
              </div>
            </div>
          ))}
        </div>

        {/* Desktop: Full grid */}
        <div className="hidden lg:block">
          <div className="grid grid-cols-4 gap-6 mb-8">
            {skillCategories.map((category, catIndex) => (
              <div 
                key={catIndex}
                className="bg-tech-navy/30 rounded-xl p-4 border border-tech-cyan/10"
              >
                <h3 className="text-lg font-bold text-tech-cyan mb-4 text-center">
                  {category.title}
                </h3>
                <div className="grid grid-cols-2 gap-3">
                  {category.skills.map((skill, skillIndex) => (
                    <div 
                      key={skillIndex}
                      className="flex flex-col items-center p-3 bg-tech-blue/20 rounded-lg hover:bg-tech-blue/30 transition-colors"
                    >
                      <i className={`${skill.icon} text-xl mb-2`}></i>
                      <span className="text-xs text-tech-light text-center">
                        {skill.name}
                      </span>
                    </div>
                  ))}
                </div>
              </div>
            ))}
          </div>
        </div>

        {/* Additional Skills */}
        <div className="mt-8">
          <div className="flex overflow-x-auto lg:flex-wrap lg:justify-center gap-3 pb-4 lg:pb-0">
            {[
              { name: "VS Code", icon: "devicon-vscode-plain colored" },
              { name: "GitHub", icon: "devicon-github-original colored" },
              { name: "Tailwind", icon: "devicon-tailwindcss-plain colored" },
              { name: "Figma", icon: "devicon-figma-plain colored" },
              { name: "Nginx", icon: "devicon-nginx-original colored" },
              { name: "Jenkins", icon: "devicon-jenkins-plain colored" }
            ].map((skill, index) => (
              <div 
                key={index}
                className={`flex-shrink-0 flex items-center gap-2 px-3 py-2 bg-tech-navy/20 rounded-lg border border-tech-cyan/5 ${
                  index >= 4 ? 'hidden lg:flex' : ''
                }`}
              >
                <i className={`${skill.icon} text-lg`}></i>
                <span className="text-xs text-tech-light">{skill.name}</span>
              </div>
            ))}
          </div>
        </div>
      </div>
    </section>
  );
};

export default SkillsMobileHorizontal;
